public void testIsInTheSameRegionAs() {
    class Point {
        double x;
        double y;
        int region;

        public Point(double x, double y) {
            this.x = x;
            this.y = y;
            this.region = 0; // Default region value
        }

        public boolean isInTheSameRegionAs(Point other) {
            return this.region == other.region;
        }
    }

    Point point1 = new Point(1.0, 2.0);
    Point point2 = new Point(3.0, 4.0);
    point1.region = 1;
    point2.region = 1;
    assertTrue(point1.isInTheSameRegionAs(point2));

    Point point3 = new Point(5.0, 6.0);
    Point point4 = new Point(7.0, 8.0);
    point3.region = 2;
    point4.region = 3;
    assertFalse(point3.isInTheSameRegionAs(point4));
}


